import React from "react";
import { Link } from "@reach/router";
import { AppBar } from "@material-ui/core";

const Title = () => {
  return (
    <AppBar>
      <Link to="/">
        <h1>NC-News</h1>
      </Link>
    </AppBar>
  );
};

export default Title;
